import AdminHomePage from './pages/adminHome/adminHome.jsx';

import {
    BrowserRouter as Router,
    Route,
    Routes,
    Link
} from "react-router-dom";

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/adminHome">
                    <AdminHomePage/>
                </Route>
                
            </Routes>
        </Router>
         
    )
};

export default App;
